import React, { Component } from "react";
import Tone from "tone";

export default class Synth extends Component {
  synth = new Tone.AMSynth().toMaster();

  render() {
    return (
      <div>
        <button className="Synth" onclick={this.synth.triggerAttack}>
          Play
        </button>
      </div>
    );
  }
}
